import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { startGetWishlists } from '../Actions/wishlist';
import { Card } from 'react-bootstrap';

const WishlistItems = () => {
  const dispatch = useDispatch();
  const wishlistItems = useSelector(state => state.wishlist.data);

  useEffect(() => {
    dispatch(startGetWishlists());
  }, [dispatch]);

  return (
    <div style={{ paddingTop: '40px' }}>
      <h2>Wishlist Items</h2>
      <ul style={{ listStyle: 'none', padding: 0 }}>
        {wishlistItems.map((item, index) => (
          <li key={index} style={{ marginBottom: '1rem' }}>
            <Card>
              <Card.Img variant="top" src={`http://localhost:3009/${item.images}`} />
              <Card.Body>
                <Card.Title>{item.caption}</Card.Title>
                <Card.Text>
                  Price: {item.price}
                </Card.Text>
              </Card.Body>
            </Card>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default WishlistItems;
